   <Typography
  sx={{
    color: '#39ff14',  // neon yeşili gibi parlak renk
    textShadow: `
      0 0 5px #39ff14,
      0 0 10px #39ff14,
      0 0 20px #39ff14,
      0 0 40px #0fa,
      0 0 80px #0fa,
      0 0 90px #0fa,
      0 0 100px #0fa,
      0 0 150px #0fa
    `,
  }}
>
  Neon Yazı
</Typography>
  );
};

export default About;
